import React from 'react';
import { Typography, Container } from '@mui/material'


const Footer = () => {
    return (
        <footer>
            <Container>
                <Typography variant='h4' align='center'>
                    ©️ 2024 Student-Hub!!!
                </Typography>
            </Container>
        </footer>
    )
}

export default Footer;
